description:
Zoey had a huge fallout with her mom over her grades last semester in college. She couldn't take the arguing and fussing anymore, so she packed a couple bags and left. It was a spur of the moment reaction, and Zoey immediately realized she really didn't have a place to go, but then she remembered her buddy JMac. He was renting a house with a couple of his frat boys, and Zoey remembered they had a spare room. Plus she always had a crush on him and figured she could take this opportunity to get closer to him. After Zoey arrived, JMac came around to her in the guest room, and she explained her dilemma to him. There was an instant attraction, and she didn't waste any time putting the moves on him. JMac didn't really catch on right away, but eventually, Zoey's actions were unmistakable. And once he made sure she was 18, he was more than willing to show her a good time.


